import React, {Component} from 'react';
import { auth, createUserDocument } from './firebase';

class Home extends Component {

    logout = () => {
        auth.signOut();
    }

    render(){
        return(
            <div>
                <h1>You are home!</h1>
                <button onClick={this.logout}>Logout</button>
            </div>
        )
    }
}

export default Home;
